import React from "react";

const FeedbackDisplay = ({ feedback }) => {
  if (!feedback) return null;
  if (feedback.error) return <div style={{ color: "red" }}>{feedback.error}</div>;

  return (
    <div>
      <h2>Resume Score: {feedback.score || "N/A"}</h2>
      <h3>Suggested Improvements</h3>
      <ul>
        {feedback.improvements?.map((item, idx) => <li key={idx}>{item}</li>)}
      </ul>
      <h3>Skill Match</h3>
      <div>{feedback.skill_match}</div>
      <h3>Comments</h3>
      <div>{feedback.comments}</div>
    </div>
  );
};

export default FeedbackDisplay;
